import React from 'react';
import styles from "./../../css/facility.css";
import { Link } from 'react-router-dom';
import axios from 'axios';
function Facility() {

    return (
        <div className={styles.main_container}>
            <header>
                <Link to="/register"><image styles={styles.register_image}/>회원가입</Link>
                <Link to="/login"><image styles={styles.login_image}/>로그인</Link>
            </header>
        </div>
    )
}
export default Facility;
